def is_valid_backup(content_type, content):
    valid_types = {"application/octet-stream", "application/zip", "application/x-gzip", "text/csv", "text/plain", "application/xml", "text/xml", "application/json", "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet", "application/vnd.ms-powerpoint", "application/vnd.openxmlformats-officedocument.wordprocessingml.document", "application/vnd.ms-excel", "application/msword", "application/pdf", "application/x-rar-compressed", "application/x-7z-compressed", "application/x-zip-compressed", "application/x-compressed", "application/x-dump", "application/x-mysql", "application/sql", "application/x-tar", "application/gzip", "application/x-config", "application/x-metadata", "application/x-encrypted", "application/database-backup", "application/x-restore", "application/x-backup", "application/zlib", "application/zstd", "application/vnd.rar", "application/x-gtar", "application/x-bzip", "application/x-bzip2", "application/x-7z-compressed"}

    if content_type in valid_types:
        return not is_binary_file(content)

    return False


def is_binary_file(file):
    try:
        return isinstance(file.read(0), bytes)
    except io.UnsupportedOperation:
        return True


def is_database_console(content_type):
    valid_types = {"text/html", "text/plain"}
    return content_type in valid_types


def is_directory_listing(content_type, response_text):
    valid_types = {"text/html"}
    return content_type in valid_types and "Index of" in response_text


